import React, { Component } from "react";
import adi from "../images/adi.jpg";
import Tilt from "react-tilt";

class About extends Component {
  render() {
    return (
      <>
        <div style={{ marginTop: -21, background: "aliceblue" }}>
          <h2 style={{ display: "flex", justifyContent: "center" }}>About</h2>
          <Tilt options={{ max: 30 }}>
            <div style={{ display: "flex", justifyContent: "center" }}>
              <img src={adi} height={330} marginLeft={405} />
            </div>
          </Tilt>
        </div>

        <div
          style={{
            marginTop: 26,
            marginLeft: 162,
            marginRight: 119,
            fontSize: 24,
            fontWeight: 300,
          }}
        >
          Hie i'm Aditya Barve ,Persuing B.tech from Medicaps University
          ,Indore.I'm Passionate aboot web developement.
        </div>
      </>
    );
  }
}

export default About;
